      return (
        <section className='t-promoted'>
        <div className='t-promoted__btn'>
          <div className='t-promoted__content'>
            Name: {name}</div>
          <div className='t-promoted__content'>
            Salary: {salary}</div>
          <div className='t-promoted__content'>
            Age: {age}</div>
        </div>
        {/* <button onClick={App} className='c-btn c-btn--outline'>Reset</button> */}
        </section>
      )
    }

export default EmployeeDetails;
